const Repo = (props) => {
    const repo = props.repo;
    const repoName = repo.name;
    const lastCommitDate = repo.updated_at.slice(0,10);
    const creationDate = repo.created_at.slice(0,10);
    const repoUrl = repo.url;
    const repoCommits = props.commits;

    let repoDescription;
    if (repo.description == null) {
        repoDescription = "N/A"
    }
    else {
        repoDescription = repo.description;
    }
    let commitList = "<div>";
    for (let i = 0; i<repoCommits.length; i++) {
      commitList += "<h2>Commit " + (i+1) + "</h2>"
    }


  return (
    <div>
        <h1>{repoName}</h1>
        <p>{repoDescription}</p>
        <a href={repoUrl}>LINK</a>
        <br/>
        <h2>COMMITS:</h2>
        <br/>
        <p><i>Created: {creationDate}</i></p>
        <p><i>Last updated: {lastCommitDate}</i></p>

    </div>
  )
}

export default Repo
